import ExpenseItem from "./ExpenseItem";
function NewExpense(props) {
  return (
    <div>
      <ExpenseItem title={props.data[0].title} data={props.data[0].date} 
      amount={props.data[0].amount}/>
    </div>
  );
}
export default NewExpense;
